import React from 'react';
import {Row, Col, Container} from 'react-bootstrap';
import './sidebar.css';
import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
        
            <Row className='base'>
                <Col xs={2} md={1} className="sidebar"/>
                <Col>
                    <Row  className="main">
                        <Col className='header'>XM Studio</Col>
                        <Col className='content'>'Elllllooo there mateyss!</Col>
                    </Row>
                </Col>
            </Row>
            
        </Container>
    )
}

export default Example;
